import React from 'react';
import './Sidebar.css';

function Sidebar({ createScenario, createVehicle }) {
  return (
    <div className="sidebar">
      <h2>Menu</h2>
      <ul>
        <li><a href="#" onClick={createScenario}>Create Scenario</a></li>
        <li><a href="#" onClick={createVehicle}>Create Vehicle</a></li>
        {/* Add other menu items as needed */}
      </ul>
    </div>
  );
}

export default Sidebar;
